import React, { Component } from "react";
import './Navbar.css'
import * as Icons from 'react-icons/bs';
import Logo from './icon.png'

class Navbar extends Component {
    state = {click: false}
    handleClick = () => {
        this.setState({click: !this.state.click})
    }
    jj

    isLoggedIn() {
        return false;
    }

    render() {
        const loggedIn = this.isLoggedIn();
        const MenuItems = [
            {
                title: 'Home',
                url: '/UserAppo',
                cName: 'nav-links',
            },
            {
                title: 'About',
                url: '/',
                cName: 'nav-links',
            },
            {
                title: 'Services',
                url: '/serviceDash',
                cName: 'nav-links',
            },
            {
                title: 'Contact us',
                url: '#',
                cName: 'nav-links',
            },
            {
                title: 'Login',
                url: '/login.html',
                icon: <Icons.BsPeopleCircle />,
                cName: 'nav-links-login',
            }
        ]
        return (
            <nav className="NavbarItems">
                <a href='/'>
                    <h1 className="navbar-logo">
                        <img className="logo" src={Logo} />
                        BookInn
                    </h1>
                </a>
                <div className="menu-icon" onClick={this.handleClick}>
                    <i className={this.state.click ? 'fas fa-times': 'fas fa-bars'}></i>
                </div>
                <ul className={this.state.click ? 'nav-menu active':'nav-menu'}>
                    {MenuItems.map((item, index) => {
                        return (
                            <li key={index}> 
                                <a className={item.cName} href={item.url}>
                                    {item.icon} {item.title}
                                </a>
                            </li>
                        )
                    })}

                    {/*
                        loggedIn === true ? 
                            <li>
                                <p>User</p>
                            </li>
                        : loggedIn === false ?
                            <>
                            <li><a className="nav-links" href="/register.html">Sign Up</a></li>
                            <li><a className="nav-links" href="/login.html">Login</a></li>
                            </>
                        : <br/>*/
                    }
                </ul>
            </nav>
        );
    }
}

export default Navbar;
